import { View, Text, TouchableOpacity, Image } from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
import { COLORS, icons } from '../constants'

const Home = ({ navigation }) => {
  return (
    <SafeAreaView style={{
      flex: 1,
      backgroundColor: COLORS.white
    }}>
      <View style={{
        flex: 1,
        flexDirection:'row',
        justifyContent:'space-between',
        backgroundColor: COLORS.white,
        padding: 16,
        maxHeight:100
      }}>
        <TouchableOpacity
          onPress={() => navigation.toggleDrawer()}
          style={{
            height: 45,
            width: 45,
            borderRadius: 999,
            alignItems: "center",
            justifyContent: "center",
            backgroundColor: COLORS.gray
          }}
        >
          <Image
            source={icons.menu}
            resizeMode='contain'
            style={{
              height: 24,
              width: 24,
              tintColor: COLORS.black
            }}
          />
        </TouchableOpacity>
        <Text
          style={{
            fontSize: 18,
            fontWeight: "bold",
            color: COLORS.black,
            marginTop:10,
            marginLeft:10,
            height:50
          }}
          >SIPBUN BENGKALIS
          </Text>
          <Image
            source={icons.logo}
            resizeMode='contain'
            style={{
              height: 40,
              width: 40,
              tintColor: COLORS.black,

            }}
          />
      </View>
      <View style={{
        flex: 1,
        backgroundColor: COLORS.white,
        margin:0
      }}>
        <Text
          style={{
            fontSize: 18,
            fontWeight: "bold",
            color: COLORS.black,
          }}
          >SISTEM INFORMASI PERKEBUNAN BENGKALIS
        </Text>
      </View>
    </SafeAreaView>
  )
}

export default Home
